import time
from typing import List


class Solution:
    # time complexity: O(n^2)
    # space complexity: O(n)
    def shortestPalindrome(self, s: str) -> str:
        rs = s[::-1]

        n = len(s)
        for i in range(n + 1):
            if s.startswith(rs[i:]):
                return rs[:i] + s

    # time complexity: O(n^2)
    # space complexity: O(1)
    # Time Limit Exceeded
    def shortestPalindrome2(self, s: str) -> str:
        end = len(s) - 1
        i, j = 0, end
        while i < j:
            if s[i] != s[j]:
                end -= 1
                i, j = 0, end
            else:
                i += 1
                j -= 1

        return s[end + 1:][::-1] + s

    # time complexity: O(n)
    # add '#' to prevent prefix exceed origin str
    def shortestPalindrome3(self, s: str) -> str:
        t = s + "#" + s[::-1]
        nxt = self.getNext(t)
        return s[nxt[-1]:][::-1] + s

    # nxt[i] = j denotes s[0,..,j-1] == s[i - j,..,i-1]
    def getNext(self, s: str) -> List[int]:
        n = len(s)
        nxt = [0] * (n + 1)

        i, j = 1, 0
        while i < n:
            if s[i] == s[j]:
                i += 1
                j += 1
                nxt[i] = j
            elif j > 0:
                j = nxt[j]
            else:
                i += 1

        return nxt


